import React from 'react'
import PropTypes from 'prop-types'
import { Link } from 'react-router'

const InvoiceCounter = props => {
  const { usedInvoice } = props

  return (
    <div className='invoice-counter'>
      <p>
        <i className='mdi mdi-alert invoice-counter__icon' />{' '}
        {`Facturas emitidas: ${usedInvoice} de 5, `}
      </p>
      <Link to={'/'} className='invoice-counter__link'>
        actualiza a plan premium
      </Link>
    </div>
  )
}

export default InvoiceCounter

InvoiceCounter.propTypes = {
  usedInvoice: PropTypes.number
}

InvoiceCounter.defaultProps = {
  usedInvoice: 0
}
